@investing・88 

Asset diversification requirement has been implemented in the API, currently with minimum asset count `3`, and maximum allocation `1 / 3 ** 0.5`. A minimum allocation requirement may also be implemented soon to limit circumvention.

On another note, if you used `simst` in the hours after recalc today (June 25 UTC), please delete `Investing/core/db/daily.db` to ensure market data integrity. It’s a one-off action that won’t be needed in the future

@investing・88 Miners:

- A new minimum allocation threshold is now in place in the API, replacing the old fixed value 0.001.

- The dedupe matrix page has a new feature called “darkroom” (top left), making it easier to visually identify close-distance UID pairs.

@investing・88 Miners:

The starting day in individual DEC will be changed to 15, replacing the current 30. It will roll out in the next few days. Please **make adjustment to your strategy ASAP** to avoid sudden reduction of score.

This will likely be the last update until the Phase II launch of US stocks.

@investing・88 

Update 0.8.1 has been pushed to GitHub, adjusting the individual DEC starting day from 30 to 15. No action is required as all miners and validators will auto update.

We'd love to see long-running miners actively rebalancing and continuously thriving.

